/**
 * footer.js — Keep1R брендинг + футер для всех страниц CRM
 * Автоматически добавляет:
 * - Keep1R брендинг футер внизу каждой страницы
 * - Космонавт-маскот (разный для каждой страницы)
 * - Правовое поле (placeholder)
 */
(function() {
'use strict';

// ── Логотип SVG ──────────────────────────────────────────────
var LOGO_SVG = 'data:image/svg+xml;base64,';

// ── Космонавты по страницам ──────────────────────────────────
var ASTRONAUTS = {
  'welcome': 'data:image/png;base64,',
  'calculator': 'data:image/png;base64,',
  'dashboard': 'data:image/png;base64,',
  'board': 'data:image/png;base64,',
  'executors': 'data:image/png;base64,',
  'payouts': 'data:image/png;base64,',
  'admin': 'data:image/png;base64,',
  'assign-work': 'data:image/png;base64,',
};

// ── CSS ─────────────────────────────────────────────────────
var css = `
#k1r-footer {
  background: #0a0f1e;
  color: #64748b;
  font-family: -apple-system, BlinkMacSystemFont, sans-serif;
  border-top: 1px solid rgba(59,130,246,0.15);
  margin-top: 48px;
  position: relative;
  overflow: hidden;
}
#k1r-footer-main {
  max-width: 1100px;
  margin: 0 auto;
  padding: 32px 24px 24px;
  display: flex;
  align-items: flex-end;
  justify-content: space-between;
  gap: 32px;
  flex-wrap: wrap;
}
#k1r-footer-brand {
  display: flex;
  flex-direction: column;
  gap: 10px;
}
#k1r-footer-logo {
  height: 48px;
  width: auto;
  opacity: 0.9;
}
#k1r-footer-tagline {
  font-size: 0.78rem;
  color: #475569;
  line-height: 1.5;
  max-width: 280px;
}
#k1r-footer-links {
  display: flex;
  gap: 20px;
  flex-wrap: wrap;
}
#k1r-footer-links a {
  color: #64748b;
  text-decoration: none;
  font-size: 0.8rem;
  transition: color 0.15s;
  display: flex;
  align-items: center;
  gap: 5px;
}
#k1r-footer-links a:hover { color: #a78bfa; }
#k1r-footer-astronaut {
  height: 120px;
  width: auto;
  opacity: 0.85;
  align-self: flex-end;
  pointer-events: none;
  flex-shrink: 0;
}
#k1r-footer-legal {
  background: #060c18;
  border-top: 1px solid rgba(255,255,255,0.04);
}
#k1r-footer-legal-inner {
  max-width: 1100px;
  margin: 0 auto;
  padding: 16px 24px;
  font-size: 0.72rem;
  color: #334155;
  line-height: 1.6;
  display: flex;
  flex-wrap: wrap;
  gap: 8px 24px;
  align-items: center;
}
#k1r-footer-legal-inner a {
  color: #475569;
  text-decoration: none;
}
#k1r-footer-legal-inner a:hover { color: #64748b; }
.k1r-legal-sep { color: #1e293b; }
@media (max-width: 640px) {
  #k1r-footer-astronaut { height: 80px; }
  #k1r-footer-main { padding: 24px 16px 16px; gap: 20px; }
  #k1r-footer-links { gap: 12px; }
}
`;

// ── Инжект ───────────────────────────────────────────────────
window.initFooter = function(legalInfo) {
  // CSS
  var style = document.createElement('style');
  style.textContent = css;
  document.head.appendChild(style);

  // Определяем страницу
  var page = window.location.pathname.split('/').pop().replace('.html','');
  var astronautSrc = ASTRONAUTS[page] || ASTRONAUTS['dashboard'];

  // Правовое поле
  var legalHtml = legalInfo || '<span>© 2025–2026 Keep1R PPF & Vinyl. Все права защищены.</span><span class="k1r-legal-sep">|</span><span>Информация на сайте носит ознакомительный характер</span><span class="k1r-legal-sep">|</span><a href="https://keep1r.ru" target="_blank">keep1r.ru</a>';

  var html = `
<div id="k1r-footer">
  <div id="k1r-footer-main">
    <div id="k1r-footer-brand">
      <img id="k1r-footer-logo" src="${LOGO_SVG}" alt="Keep1R" onerror="this.style.display='none'">
      <div id="k1r-footer-tagline">
        Антигравийные плёнки · Оборудование<br>
        CRM-системы · Консалтинг<br>
        Калькулятор предоставлен благодаря плёнке Keep1R
      </div>
      <div id="k1r-footer-links">
        <a href="https://keep1r.ru" target="_blank">🌐 keep1r.ru</a>
        <a href="https://t.me/PPFKeep1R" target="_blank">✈️ @PPFKeep1R</a>
        <a href="tel:+79303371008">📞 +7 930 337-10-08</a>
      </div>
    </div>
    <img id="k1r-footer-astronaut" src="${astronautSrc}" alt="">
  </div>
  <div id="k1r-footer-legal">
    <div id="k1r-footer-legal-inner">${legalHtml}</div>
  </div>
</div>`;

  document.body.insertAdjacentHTML('beforeend', html);
};

// Автозапуск при DOMContentLoaded
document.addEventListener('DOMContentLoaded', function() {
  initFooter();
});

})();
